import React from 'react';
import {Typography} from '@material-ui/core';
import '../App.css';
import Card from 'react-bootstrap/Card'
import Square from '.././experiences/square.js'
import Canada from '.././experiences/canada.js'
import Pinterest from '.././experiences/pinterest.js'
import BVP from '.././experiences/bvp.js'
import Twitter from '.././experiences/twitter.js'
import "bootstrap/dist/css/bootstrap.min.css";
import styles from '../styles.js';
import AboutCard from "../cards/About card";

// import LightMode from './LightMode'

const ColoredLine = ({ color }) => (
    <hr
        style={{
            color: "black"
        }}
    />
);

function ExperienceCardHome() {
    const classes = styles();

    return (

        <div className="App">

                <Card
                    className={classes.smallSpace}>
                    <Card.Body>
                        <Card.Title><b>Experience</b></Card.Title>
                        <Square />
                        <ColoredLine />

                        <Canada />
                        <ColoredLine />

                        <Pinterest />
                        <ColoredLine />

                        <BVP />
                        <ColoredLine />

                        <Twitter />

                    </Card.Body>
                </Card>

        </div>
    );
}

export default ExperienceCardHome;
